import PropTypes from 'prop-types';
import { Redirect, Switch } from 'react-router-dom';
import { ROUTES } from '../../config/constants';
import Layout from '../Layout/Layout';
import PrivateRoute from '../shared/PrivateRoute/PrivateRoute';
import Settings from '../Settings/Settings';
import Configurations from '../Configurations/Configurations';
import React from 'react';
import History from '../History/History';

const PrivateRoutes = props => {
    return (
        <Layout>
            <Switch>
                <PrivateRoute path={ROUTES.settings.path} component={Settings} isAuthenticated={true} />
                <PrivateRoute
                    exact
                    path={ROUTES.configurations.path}
                    component={Configurations}
                    isAuthenticated={true}
                />
                <PrivateRoute
                    exact
                    path={ROUTES.configurations.path}
                    component={Configurations}
                    isAuthenticated={true}
                />
                <PrivateRoute exact path={ROUTES.history.path} component={History} isAuthenticated={true} />
                <Redirect from={'/'} to={ROUTES.login.path} />
            </Switch>
        </Layout>
    );
};

PrivateRoutes.propTypes = {};

export default PrivateRoutes;
